import React, {useState} from 'react';

function FunctionCounter() {
    const [count,setCount] = useState(0);

    const increase = () => setCount(count+1);

    return(
        <div>
            <button onClick = {increase}> + </button>
            <h1>{count}</h1>
        </div>
    )
}

export default FunctionCounter;
